import React, { Component } from 'react'
import profilepic from '../img/me.png'
import ReactTypingEffect from 'react-typing-effect'

class About extends Component {
    render() {
        return(
            <div className="condiv about">
                <h1 className="subtopic">About Me</h1>
                <img src={profilepic} alt="profile" className="profilepic" />
                {/* <img src={profilepic} /> */}
                <h3>Hi, I'm NiLout</h3>
                <ReactTypingEffect text={['I am NiLout', 'I am a Web Developer']} speed={80} eraseDelay={200} className="typingeffect" />
                <p>Thank You for visiting my website About me is that I'm hilarious person, Easy to get along with others and I'm someone who always listens when others speak.I'm currently live in TaoHai village Sangthong district and vientiane capital. Now I study at National University of Laos Department of Computer Engineering and Information Technology </p>
            </div>
        );
    }
}

export default About;
